import React, { useState, useEffect } from "react";
import axios from "axios";
import ARViewer from "./ARViewer";
import Modal3D from "./Modal3D";
import "./PalestinianReality.css";

const regionsData = [
  {
    title: "الضفة الغربية",
    color: "#10b981",
    stats: { population: "3.2 مليون", unemployment: "26%", settlements: "132" },
    updates: "اعتقالات في نابلس وجنين",
  },
  {
    title: "قطاع غزة",
    color: "#ef4444",
    stats: { population: "2.3 مليون", unemployment: "47%", years: "17 سنة" },
    updates: "أزمة كهرباء ومياه مستمرة",
  },
  {
    title: "فلسطين 48",
    color: "#3b82f6",
    stats: {
      population: "1.9 مليون",
      unemployment: "18%",
      demolitions: "مستمر",
    },
    updates: "قوانين تمييزية وعنصرية",
  },
  {
    title: "الشتات",
    color: "#8b5cf6",
    stats: { refugees: "6.4 مليون", countries: "58 دولة", camps: "68 مخيم" },
    updates: "مطلب أساسي وحق مقدس",
  },
];

const PalestinianReality = () => {
  const [newsItems, setNewsItems] = useState([]);
  const [selectedModel, setSelectedModel] = useState(null);
  const [isModalOpen, setIsModalOpen] = useState(false);

  useEffect(() => {
    axios
      .get("http://localhost:8000/api/news/palestinian_reality")
      .then((res) => setNewsItems(res.data))
      .catch((err) => console.error(err));
  }, []);

  const openModal = (url) => {
    setSelectedModel(url);
    setIsModalOpen(true);
  };
  const closeModal = () => {
    setSelectedModel(null);
    setIsModalOpen(false);
  };

  return (
    <section className="palestinian-reality">
      <div className="pr-header">
        <h2>الواقع الفلسطيني اليوم</h2>
        <p>تغطية شاملة للأوضاع السياسية والمعيشية في فلسطين والشتات</p>
      </div>

      <div className="pr-regions">
        {regionsData.map((region, i) => (
          <div key={i} className="pr-card">
            <div
              className="pr-card-header"
              style={{ background: region.color }}
            >
              <h3>{region.title}</h3>
            </div>
            <div className="pr-card-body">
              {Object.entries(region.stats).map(([key, value], idx) => (
                <div key={idx} className="stat">
                  <span>{key}</span>
                  <span>{value}</span>
                </div>
              ))}
              <div className="updates">{region.updates}</div>
            </div>
          </div>
        ))}
      </div>

      <div className="pr-carousel">
        {newsItems.slice(0, 5).map((item, idx) => (
          <div
            key={idx}
            className="pr-carousel-item"
            onClick={() => openModal(item.modelUrl)}
          >
            <div className="image">
              <i className="fas fa-newspaper"></i>
              <span className="badge">عاجل</span>
              <span className="time">منذ ساعتين</span>
            </div>
            <div className="content">
              <h3>{item.title}</h3>
              <p>{item.content.substring(0, 100)}...</p>
            </div>
          </div>
        ))}
      </div>

      <Modal3D
        isOpen={isModalOpen}
        onClose={closeModal}
        modelUrl={selectedModel}
      />
    </section>
  );
};

export default PalestinianReality;
